  [],\n\t\"revision_timestamp\": \"2016-08-04T08:16:59.801433\",\n\t\"name\": \"refuge-narrative-report-january-april-1962-kenai-national-moose-range\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kenai National
  Wildlife Refuge summarizes refuge activities from January through April of 1962.
  \ The report begins with general information about weather conditions and habitat
  conditions on the refuge.  Wildlife- including migratory birds, upland game birds,
  big game animals, predacious birds, and fish- is also covered.  The report includes
  a refuge development section which discusses physical developments, collections,
  receipts, control of vegetation, and fires on the refuge.  Economic uses of the
  refuge are outlined; timber removal, fur harvest, and commercial fishing were the
  primary uses during this period.  A progress report on field investigations and
  research is provided. The public relations section of the report discusses recreational
  uses of the refuge, refuge visitors, refuge participation, hunting, violations,
  and safety.  Items of interest, maps, photographs, and N-R forms are provided at
  the end of the report.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
